      "body": "\n                   \n\n\n  Modules\n  AppModule\n\n\n\n    \n            Your browser does not support SVG\n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Infos\n    \n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            src/app/app.module.ts\n        \n\n\n        \n            \n                \n                    Declarations\n                    \n                            \n                                AppComponent\n                            \n                            \n                                RegisterComponent\n                            \n                            \n                                LoginComponent\n                            \n                            \n                                HomeComponent\n                            \n                            \n                                BlogComponent\n                            \n                            \n                                FotosComponent\n                            \n                            \n                                FotosComponent\n                            \n                            \n                                ManualsComponent\n                            \n                            \n                                TinyMceComponent\n                            \n                            \n                                PlattenComponent\n                            \n                            \n                                PlattenDetailsComponent\n                            \n                            \n                                SafePipe\n                            \n                            \n                                OrderBy\n                            \n                            \n                                ReversePipe\n                            \n                            \n                                PageNotFoundComponent\n                            \n                            \n                                LinkAccountComponent\n                            \n                            \n                                DropzoneComponent\n                            \n                            \n                                ChatComponent\n                            \n                            \n                                FroalaEditorDirective\n                            \n                            \n                                FroalaViewDirective\n                            \n                            \n                                StickyDirective\n                            \n                    \n                \n                \n                    Providers\n                    \n                            \n                                FirebaseAuthService\n                            \n                            \n                                FirebaseDatabaseService\n                            \n                            \n                                FirebaseStorageService\n                            \n                    \n                \n                \n                    Bootstrap\n                    \n                            \n                                AppComponent\n                            \n                    \n                \n            \n        \n    \n    \n        import { BrowserModule } from '@angular/platform-browser';\r\nimport { NgModule } from '@angular/core';\r\nimport { CommonModule } from '@angular/common';\r\nimport { FormBuilder, FormsModule, ReactiveFormsModule } from '@angular/forms';\r\nimport { AngularFireModule } from 'angularfire2';\r\nimport { RouterModule } from '@angular/router';\r\nimport { MaterialModule } from '@angular/material';\r\nimport { AppComponent } from './app.component';\r\nimport { RegisterComponent } from './components/register/register.component';\r\nimport { LoginComponent } from './components/login/login.component';\r\nimport { ROUTES_CONFIG } from './config/routes.config';\r\nimport { FIREBASE_CONFIG } from './config/firebase.config';\r\nimport { FirebaseAuthService } from './services/firebase-auth.service';\r\nimport { FirebaseDatabaseService } from './services/firebase-database.service';\r\nimport { HomeComponent } from './components/home/home.component';\r\nimport { BlogComponent } from './components/blog/blog.component';\r\nimport { FotosComponent } from './components/fotos/fotos.component';\r\nimport { TinyMceComponent } from './tinymce/tinymce.component';\r\nimport { PlattenComponent } from './components/platten/platten.component';\r\nimport { HttpModule, JsonpModule } from '@angular/http';\r\nimport { SafePipe } from './pipes/safe.pipe';\r\nimport { PageNotFoundComponent } from './page-not-found/page-not-found.component';\r\nimport { FirebaseStorageService } from './services/firebase-storage.service';\r\nimport { LinkAccountComponent } from './components/link-account/link-account.component';\r\nimport { PlattenDetailsComponent } from './components/platten/platten-details/platten-details.component';\r\nimport { ManualsComponent } from './components/manuals/manuals.component';\r\nimport { DropzoneComponent } from './dropzone/dropzone.component';\r\nimport { SlimLoadingBarModule } from 'ng2-slim-loading-bar';\r\nimport { ChatComponent } from './components/chat/chat.component';\r\nimport { FroalaEditorDirective, FroalaViewDirective } from './froala/froala.directives';\r\nimport { BrowserAnimationsModule } from '@angular/platform-browser/animations';\r\nimport { OrderBy } from './pipes/orderBy.pipe';\r\nimport { ReversePipe } from './pipes/reverse.pipe';\r\nimport { FlexLayoutModule } from '@angular/flex-layout';\nimport { StickyDirective } from './directives/sticky.directive';\r\n\r\n@NgModule({\r\n  declarations: [\r\n    AppComponent,\r\n    RegisterComponent,\r\n    LoginComponent,\r\n    HomeComponent,\r\n    BlogComponent,\r\n    FotosComponent,\r\n    FotosComponent,\r\n    ManualsComponent,\r\n    TinyMceComponent,\r\n    PlattenComponent,\r\n    PlattenDetailsComponent,\r\n    SafePipe,\r\n    OrderBy,\r\n    ReversePipe,\r\n    PageNotFoundComponent,\r\n    LinkAccountComponent,\r\n    DropzoneComponent,\r\n    ChatComponent,\r\n    FroalaEditorDirective,\r\n    FroalaViewDirective,\r\n    StickyDirective\r\n  ],\r\n  imports: [\r\n    // Router\r\n    RouterModule.forRoot(ROUTES_CONFIG),\r\n    // Browser\r\n    BrowserModule,\r\n    // Common\r\n    CommonModule,\r\n    // AJAX\r\n    HttpModule,\r\n    JsonpModule,\r\n    // Forms\r\n    FormsModule,\r\n    ReactiveFormsModule,\r\n    // AngularFire2\r\n    AngularFireModule.initializeApp(FIREBASE_CONFIG),\r\n    // ng2 Slim Loading Bar\r\n    SlimLoadingBarModule.forRoot(),\r\n    MaterialModule,\r\n    FlexLayoutModule,\r\n    BrowserAnimationsModule\r\n  ],\r\n  providers: [\r\n    FirebaseAuthService,\r\n    FirebaseDatabaseService,\r\n    FirebaseStorageService,\r\n    FormBuilder\r\n  ],\r\n  entryComponents: [AppComponent],\r\n  bootstrap: [AppComponent]\r\n})\r\nexport class AppModule {\r\n\r\n}\r\n\n    \n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"
